import React from 'react';

function Home() {
    return (
        <div>
            <h1>Welcome!</h1>
            <p>I am Giovanni Sylvestre,</p>
            <p>An aspiring software developer, who is interested in solving problems, software and mobile development as well as artifical intelligence.</p>
        </div>
    );
}

export default Home;
